import styles from './Reservas.module.css';

function Reservas() {
    const obj = ['holis', 'ohli'];

    return (
        <div className={styles.bigContainer}>
            <form className={styles.formBigContainer}>
                <div className={styles.codigoLabel}>
                    <label htmlFor="">Código de reserva</label>
                    <input type="text" />
                </div>
                <div className={styles.reservasBigContainer}>
                    <div className={styles.reservasTitulo}>
                        <p>Reservas</p>
                    </div>
                    <div id={styles.desplegableOnn} className={styles.desplegable}>
                        {obj && obj.map(o => {
                            return (
                                <div className={styles.barra2}>
                                    <div className={styles.fechaSaved}>{o}</div>
                                    <button onClick={(e)=>{e.preventDefault()}} className={styles.checkIcon}>
                                        ✓
                                    </button>
                                </div>
                            )
                        })}
                    </div>
                </div>
            </form>
        </div>
    );
}

export default Reservas;
